(function(){
  var override = {};
  override['2008-7'] = 'data:image/png;base64,';
  override['2010-4'] = 'data:image/png;base64,';
  override['2010-5'] = 'data:image/png;base64,';
  override['2012-5'] = 'data:image/jpeg;base64,';
  override['2013-4'] = 'data:image/jpeg;base64,';
  override['2016-5'] = 'data:image/jpeg;base64,';
  override['2016-12'] = 'data:image/jpeg;base64,';
  override['2016-13'] = 'data:image/jpeg;base64,';
  override['2016-14'] = 'data:image/jpeg;base64,';
  override['2017-12'] = 'data:image/jpeg;base64,';
  override['2017-3'] = 'data:image/jpeg;base64,';
  override['2017-4'] = 'data:image/jpeg;base64,';
  override['2018-15'] = 'data:image/jpeg;base64,';
  override['2019-4'] = 'data:image/jpeg;base64,';
  function apply(){
    if(!Array.isArray(window.PROBLEMS_CHUNKS)) return false;
    var ok=false;
    for(var ci=0; ci<window.PROBLEMS_CHUNKS.length; ci++){
      var chunk = window.PROBLEMS_CHUNKS[ci];
      if(!Array.isArray(chunk)) continue;
      for(var i=0;i<chunk.length;i++){
        var q = chunk[i];
        var id = q && q.id;
        if(id && override[id]){ q.image = override[id]; ok=true; }
      }
    }
    return ok;
  }
  if(!apply()){ window.addEventListener('DOMContentLoaded', apply); }
})();